package jmspackage;
import javax.jms.Connection;
import javax.jms.ConnectionFactory;
import javax.jms.Destination;
import javax.jms.JMSException;
import javax.jms.MessageProducer;
import javax.jms.Session;
import javax.jms.TextMessage;


import org.apache.activemq.ActiveMQConnection;
import org.apache.activemq.ActiveMQConnectionFactory;
//import org.testng.annotations.Test;	

public class JMS {

	
	private static String url = ActiveMQConnection.DEFAULT_BROKER_URL;
	
	private static String queueName = "inbound.src.tradesec";
	
	
	public static void main(String[] args) throws JMSException {
		// TODO Auto-generated method stub

		System.out.println("ÜRL = " + url);
		System.out.println("QueueBuilderTest is now running" + url);
		
		ConnectionFactory connectionFactory=  new ActiveMQConnectionFactory(url);
		
		((ActiveMQConnectionFactory)connectionFactory).setUseAsyncSend(true);
		//((ActiveMQConnectionFactory) connectionFactory).setMaxThreadPoolSize(10);
		
		Connection connection = connectionFactory.createConnection();
		connection.start();
		
		
		Session session = connection.createSession(false, Session.AUTO_ACKNOWLEDGE);
		
		Destination destination = session.createQueue(queueName);
		
			MessageProducer producer = session.createProducer(destination);
			
		

		
		
	for (int i = 17014 ; i <=18014; i++)
	{
		  
	
		   
		TextMessage message = session.createTextMessage("<?xml version='1.0' encoding='utf-8'?><NS1:msgCRS xmlns:NS1=\"http://www.dnb.no/Markets/MIP/Services/TC\"><NS1:common><NS1:msgId>2cd54487-625c-4b0c-9947-fa2cfc628b28</NS1:msgId><NS1:msgType>Request</NS1:msgType><NS1:sendTimeStamp>2020-08-26T14:14:38.395+02:00</NS1:sendTimeStamp><NS1:source>CSS</NS1:source><NS1:destination>TRADECHANNEL</NS1:destination><NS1:environment>PROD</NS1:environment></NS1:common><NS1:request><NS1:internalReference>" + i +"</NS1:internalReference><NS1:baseInternalReference>"+i + "</NS1:baseInternalReference><NS1:originSystem>CSS</NS1:originSystem><NS1:baseOriginSystem>CSS</NS1:baseOriginSystem><NS1:messageBlock><NS1:type>TRANSACTION</NS1:type><NS1:format>JSON</NS1:format><NS1:encoding>UTF-8</NS1:encoding><NS1:content></NS1:content></NS1:messageBlock></NS1:request></NS1:msgCRS>");
		
		producer.send(message);
		
		System.out.println("Message -  " + message.getText()+ " ,send Message successfully");
		
		  }
	//close outside the loop
	producer.close();
   session.close();
  connection.close();

	
	System.out.println("QueueBuilderTest is now completed");
	}
	


}

